import { useEffect } from "react";
import { logout } from "../services/authService";

const Logout = ({ check }) => {
  useEffect(() => {
    logout();
    console.log("into logouuuuuuuuuuuuuuuuuuuuuuuut");
    console.log(check);
    window.location = "/";
  }, []);

  return null;
};

export default Logout;
